Select	
		PRO_CodigoProveedor AS CODIGO, 
		PRO_Proveedorid as ID,
		PRO_Nombre AS NOMBRE,
		PRO_NombreComercial AS COMERCIAL,
		PRO_RFC AS REG_FC,
		PRO_Activo AS ACTIVO
from Proveedores
Where PRO_Activo = 1 and PRO_Eliminado = 0
Order by CODIGO


